import React, { useState } from 'react';
import AppBar from '@mui/material/AppBar';
import Button from '@mui/material/Button';
import LocalGroceryStoreIcon from '@mui/icons-material/LocalGroceryStore';
import LogoutIcon from '@mui/icons-material/Logout';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { Link as RouterLink } from 'react-router-dom'

const Home = () => {
  const [products, setProducts] = useState([]);

  const handleProductCreated = (newProduct) => {
    // Adiciona o novo produto ao estado
    setProducts([...products, newProduct]);
  };

  return (
    <>
      <CssBaseline />
      <AppBar position="relative">
        <Toolbar>
          <LocalGroceryStoreIcon sx={{ mr: 2 }} />
          <Typography variant="h6" color="inherit" noWrap>
            GreenMart
          </Typography>

          <div style={{ display: 'flex', alignItems: 'center', marginLeft: 'auto' }}>
            <Button component={RouterLink} to="/" color="inherit" style={{textDecoration: 'none'}}>
              <Typography variant="h6" color="inherit" noWrap sx={{ textTransform: 'none', mr: 1 }}>
                Logout
              </Typography>
              <LogoutIcon />
            </Button>
          </div>
        </Toolbar>
      </AppBar>
      <main>
      <Grid container spacing={2} sx={{ mt: 3 }}>
        <Grid item xs={6} className="addPromotionButton">
          <Button component={RouterLink} to="/promotion/create" sx={{ textTransform: 'none', bgcolor: "primary.main" }}>
            <Typography variant="h6" color="black" noWrap sx={{ textTransform: 'none', fontSize: "14px" }}>
              Add Promotion
            </Typography>
          </Button>
        </Grid>
        <Grid item xs={6} className="addProductButton">
          <Button component={RouterLink} to="/product/create" sx={{ textTransform: 'none', bgcolor: "primary.main" }}>
            <Typography variant="h6" color="black" noWrap sx={{ textTransform: 'none', fontSize: "14px" }}>
              Add Product
            </Typography>
          </Button>
        </Grid>
      </Grid>
        <Container sx={{ py: 3 }} maxWidth="md">
          <Grid container spacing={4}>
            {/* Renderiza os cards para cada produto no estado */}
            {products.map((product, index) => (
              <Grid item key={index} xs={12} sm={6} md={4}>
                <Card
                  sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}
                >
                  {/* Conteúdo do card usando os dados do produto */}
                  <CardMedia
                    component="div"
                    sx={{
                      pt: '56.25%',
                    }}
                    image="https://source.unsplash.com/random?wallpapers"
                  />
                  <CardContent sx={{ flexGrow: 1 }}>
                    <Typography gutterBottom variant="h5" component="h2">
                      {product.productName}
                    </Typography>
                    <Typography>
                      Category: {product.productCategory}<br />
                      Price: {product.price}<br />
                      Code: {product.productCode}
                    </Typography>
                  </CardContent>
                  {/* Botões e ações do card */}
                  <CardActions>
                    <Button size="small">View</Button>
                  </CardActions>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Container>
      </main>
      {/* Footer */}

      {/* End footer */}
      </>
  );
}

export default Home
